車載用ビデオモジュレーター（汎用）<div class="nostocks">※ご注文後のお取り寄せ商品につき、弊社に在庫がございません。<br>納期はお気軽にお問い合わせ下さい。</div><div class="Merit"><b>＜特長＞</b><p>●地デジチューナーやDVDプレーヤー等から入力されたAV信号をアナログTVの電波に変換。車載TVのアナログTVチューナーへ電波を直接送信することで、車載TVの1チャンネルまたは2チャンネルを使用して、地デジやDVDが見られるようになります。</p></div><div class="Spec"><b>＜仕様＞</b><p><br><strong>注意事項</strong><br>◆本製品を装着することにより、アナログ放送の受信感度が低下する場合があります。予めご了承ください。<br>◆適合表に記載されていない車種を装着する際は、必ず車両に装着されているアナログチューナーのアンテナ入力コネクター形状を事前にご確認ください。<br>◆他の電子機器ノイズや車両側のオルターネーターノイズ・ワイパーのモーターノイズなどがAV信号に混合し、映像及び音声に多少影響がある場合があります。予めご了承ください。<br>◆本体は必要に応じて操作できる場所に設置してください。但し、運転の邪魔にならないように設置してください。<br>◆テレビ放送と電波干渉すると、音声に雑音が混じったり映像が乱れたりします。必要に応じて1チャンネル送信／2チャンネル送信に切り替えてください。<br>◆本製品の取り付けは、必ず専門の知識・設備のある取扱業者で行ってください。<br>◆電源ハーネスの長さが足りない場合は、別途配線をご用意ください。<br>◆本製品を使用して発生した人身・物損事故、車両の故障、または破損、安全義務違反による罰金・減点等に関しての責任は一切負いません。</p></div><style type="text/css"><!--
